- input: "TEXT\x1CC00277541\x1CX0\x1C\x1CF3XA\x1CThe Committee has not engaged in
    federal election activity in 2011.  The Fairfax County Democratic Committee employs
    one full time employee, the Executive Director, whose time was less than 25 percent
    devoted to federal elections and candidates during this reporting period.  No
    other entity pays compensation for their employees to work for the Committee.
    The Committee does not engage in any fundraising on behalf of candidates for Federal
    office, so all of its reported fundraising expenses are party fundraising. The
    Committee maintains both Federal and Non Federal accounts.  In 2012, the Committee
    will begin reporting monthly, and the next report will be the February 20, 2012
    report.  In response to a letter from Senior Campaign Finance Analyst Laura Sinram
    dated August 7, 2012, a second amendment corrects our previous report which used
    the wrong percentage for allocable expenses . The amended report now uses the
    64% - 36% split.  However, during this period, the Committee erroneously made
    transfers from our nonfederal account to our federal account of an amount calculated
    on the basis of a 85% - 15% split which resulted in an overpayment from our nonfederal
    account to our federal account.  However, during 2011 we made transfers from our
    federal account to our nonfederal account that were more than enough to offset
    this overpayment.  Our first amendment also tried to correct original report in
    the same way, but because of a misunderstanding of how NGP software works did
    not actually succeed in doing so.  The third amendment responds to a letter from
    Senior Campaign Finance Analyst Laura Sinram dated March 19, 2013 and corrects
    the totals on lines 21(a)(i) and 21(a)(ii), a change made necessary by changes
    to those lines in earlier reports from 2011.  \n"
